import React from "react";

function File(props){
    /**If the files have been fetched and stored in the
     * parent component-Documents-style and return the File component
     * else return nothing.
    */
    if (props.filesLoaded){
        return(
            <div>
                <h3>{props.title}</h3>
            </div>
        );
    }
    else{
        return(
            null
        );
    }
}

export default File;
